  oz_tutorial_camera_android_chrome_browser: 'Google Chrome',
  oz_tutorial_camera_android_chrome_instruction: '<ul>\n    <li><div>No <b>Chrome</b>, toque o botão de menu (<b>“três pontos”</b>). </div></li>\n    <li><div>Selecione <b>Configurações</b>.</div></li>\n    <li><div>Role para baixo na página de configurações e selecione <b>Configurações do site</b>. </div></li>\n    <li><div>Selecione <b>Câmera</b>.</div></li>\n    <li><div>Ligue o botão de opção <b>Câmera</b>.</div></li>\n</ul>',
  oz_tutorial_camera_android_chrome_instruction_screen_allow_access: 'Altere a permissão da câmera para <strong>Permitir</strong> e feche as configurações do site',
  oz_tutorial_camera_android_chrome_instruction_screen_click_settings: 'Clique no ícone de configurações do site no início da barra de endereço',
  oz_tutorial_camera_android_chrome_instruction_screen_permissions: 'Selecione <strong>Permissões</strong>',
  oz_tutorial_camera_android_chrome_title: 'Para habilitar o acesso à câmera no <b>Google Chrome</b>, faça o seguinte:',
  oz_tutorial_camera_android_chrome_with_screens_title: 'Para continuar, permita o acesso à câmera nas configurações do seu navegador',
  oz_tutorial_camera_android_default_browser: 'Chrome',
  oz_tutorial_camera_android_default_instruction: '<ul>\n    <li><div>No <b>Chrome</b>, toque no botão de menu (<b>“três pontos”</b>).</div></li>\n    <li><div>Selecione <b>Configurações</b>.</div></li>\n    <li><div>Role para baixo na página de configurações e selecione <b>Configurações do site</b>.</div></li>\n    <li><div>Selecione <b>Câmera</b>.</div></li>\n    <li><div>Ative o botão de opção <b>Câmera</b>.</div></li>\n</ul>',
  oz_tutorial_camera_android_default_title: 'Infelizmente, não reconhecemos o seu navegador. No caso do <b>Chrome</b>, este problema pode ser resolvido da seguinte forma:',
  oz_tutorial_camera_android_edge_browser: 'Microsoft Edge',
  oz_tutorial_camera_android_edge_instruction: '<ul>\n<li><div>Clique no botão do menu (<b>“três listras”</b> ou <b>hambúrguer</b>) no canto inferior direito do navegador.</div></li>\n<li><div>Selecione <b>Configurações</b>.</div></li>\n<li><div>Selecione <b>Privacidade e segurança</b>.</div></li>\n<li><div>Abra <b>Configurações do site</b> na seção <b>Privacidade</b>.</div></li>\n<li><div>Escolha <b>Câmera</b> em <b> Permissões</b>. </div></li>\n<li><div>Defina o seletor de <b>Câmera</b> para <b>Ligado</b>.</div></li>\n</ul>',
  oz_tutorial_camera_android_edge_title: 'Para habilitar o acesso à câmera no navegador <b>Microsoft Edge</b> em um dispositivo Android, faça o seguinte:',
  oz_tutorial_camera_android_facebook_browser: 'Facebook',
  oz_tutorial_camera_android_facebook_instruction: '<ul>\n    <li><div>Com a página de verificação biométrica do aplicativo aberta, toque no botão <b>“três pontos”</b> no canto superior direito do navegador.</div></li>\n    <li><div>Selecione <b>Abrir com...</b> ou <b>Abrir no navegador</b>, em que <b>Navegador</b> é o navegador que você atribuiu por padrão (por exemplo, Chrome ou qualquer outro navegador).</div></li>\n    <li><div>Selecione <b>qualquer navegador</b> na janela que aparecerá. Um link para o site de verificação biométrica será aberto no aplicativo do navegador.</div></li>\n</ul>',
  oz_tutorial_camera_android_facebook_title: 'Se a câmera não ligar no navegador integrado do <b>Facebook</b>, faça o seguinte:',
  oz_tutorial_camera_android_firefox_browser: 'Firefox',
  oz_tutorial_camera_android_firefox_instruction: '<ul>\n    <li><div>No Firefox, toque no botão de menu ( <b>“três pontos”</b>).</div></li>\n    <li><div>Selecione <b>Configurações</b>.</div></li>\n    <li><div>Selecione <b>Permissões do site</b>.</div></li>\n    <li><div>Selecione <b>Câmera</b>.</div></li>\n    <li><div>Selecione a opção <b>Sempre perguntar</b>.</div></li>\n    <li><div>Se o acesso ainda permanecer bloqueado pelo Android, toque no botão <b>Ir para Configurações</b>. Na janela Configurações, selecione <b>Permissões do aplicativo</b> e ative o botão de opção <b>Câmera</b>.</div></li>\n</ul>',
  oz_tutorial_camera_android_firefox_title: 'Para habilitar o acesso à câmera no navegador <b>Firefox</b> em um dispositivo Android, faça o seguinte:',
  oz_tutorial_camera_android_instagram_browser: 'Instagram',
  oz_tutorial_camera_android_instagram_instruction: '<ul>\n    <li><div>Com a página de verificação biométrica do aplicativo aberta, toque no botão de menu (<b>“três pontos”</b>) no canto superior direito do navegador.</div></li>\n    <li><div>Selecione <b>Abrir com...</b> ou <b>Abrir no navegador</b>, em que <b>Navegador</b> é o navegador que você atribuiu por padrão (por exemplo, Chrome ou qualquer outro).</div></li>\n    <li><div>Selecione <b>qualquer navegador</b> na janela que aparecerá. Um link para o site de verificação biométrica será aberto no aplicativo do navegador.</div></li>\n</ul>',
  oz_tutorial_camera_android_instagram_title: 'Se a câmera não ligar no navegador integrado do <b>Instagram</b>, faça o seguinte:',
  oz_tutorial_camera_android_miui_browser: 'Xiaomi Mi',
  oz_tutorial_camera_android_miui_instruction: '<ul>\n    <li><div>No navegador MI, toque no botão <b>Perfil</b> (uma silhueta humana no canto inferior direito).</div></li>\n    <li><div>Toque no botão <b>Configurações</b> (um hexágono) ao lado do número/nome da sua conta MI.</div></li>\n    <li><div>Role para baixo na página de configurações e selecione <b>Configurações do site</b>.</div></li>\n    <li><div>Selecione <b>Câmera</b>.</div></li>\n    <li><div>Ative o botão de opção <b>Câmera</b>.</div></li>\n</ul>',
  oz_tutorial_camera_android_miui_title: 'Para habilitar o acesso à câmera no navegador <b>Xiaomi Mi</b>, faça o seguinte:',
  oz_tutorial_camera_android_opera_browser: 'Opera',
  oz_tutorial_camera_android_opera_instruction: '<ul>\n    <li><div>No <b>Opera</b>, toque no botão <b>O</b> no canto inferior direito do navegador. </div></li>\n    <li><div>Selecione <b>Configurações</b>.</div></li>\n    <li><div>Na seção <b>Confidencialidade</b>, selecione <b>Configurações do site</b>.</div></li>\n    <li><div>Selecione <b>Câmera</b>.</div></li>\n    <li><div>Ligue o botão de opção <b>Câmera</b> - <b>Sempre perguntar</b>.</div></li>\n    <li><div>Se a permissão foi cancelada acidentalmente anteriormente, o endereço do site será exibido na seção <b>Cancelado</b>. Depois de pressionar <b>LIMPAR PERMISSÕES</b>, o site solicitará novamente acesso à câmera ao passar pela verificação biométrica.</div></li>\n</ul>',
  oz_tutorial_camera_android_opera_title: 'Para habilitar o acesso à câmera no navegador <b>Opera</b>em um dispositivo Android, faça o seguinte:',
  oz_tutorial_camera_android_samsung_browser: 'Samsung',
  oz_tutorial_camera_android_samsung_instruction: '<ul>\n    <li><div>Toque no botão <b>Atualizar permissões</b>.</div></li>\n    <li><div>Uma janela de solicitação de permissão será exibida. Nesta janela, toque em <b>Permitir</b>. Em seguida, tente novamente passar na verificação biométrica.</div></li>\n</ul>\n<p> Se você tocou em <b>Cancelar</b> e sinalizou a opção <b>“Não me pergunte novamente”</b> em algum momento anterior, proceda da seguinte forma:</p>\n<ul>\n    <li><div>Toque no botão de menu (<b>“três listras”</b>) no canto inferior direito do navegador.</div></li>\n    <li><div>Selecione <b>Configurações</b></div></li>\n    <li><div>Role para baixo na página de configurações e selecione <b>Sobre o aplicativo para Internet</b></div></li>\n    <li><div>Toque no botão “i” (Informações) no canto superior direito. Uma janela com os dados do aplicativo das configurações do telefone será aberta</div></li>\n    <li><div>Selecione <b>Permissões do aplicativo</b></div></li>\n    <li><div>Ligue o botão de opção <b>Câmera</b></div></li>\n</ul>\n<p> <b>Limpando o cache no navegador Samsung.</b><br>Se o botão de opção <b>Câmera</b> estiver ligado, mas ainda não aparecer nenhuma solicitação de acesso no site, proceda da seguinte forma:</p>\n<ul>\n    <li><div>Toque no botão de menu <b>“três listras”</b> no canto inferior direito do navegador.</div></li>\n    <li><div>Selecione <b>Configurações</b></div></li>\n    <li><div>Em seguida, selecione <b>Informações pessoais</b></div></li>\n    <li><div>Selecione <b>Limpar dados de navegação</b></div></li>\n    <li><div>Mantenha estas opções marcadas: <b>Cache</b> e <b>Cookies e dados do site</b></div></li>\n    <li><div>Toque no botão <b>Limpar</b></div></li>\n</ul>',
  oz_tutorial_camera_android_samsung_title: 'Caso o navegador <b>Samsung</b> tenha permissão para usar a câmera nas configurações do telefone, na solicitação de acesso à câmera aparecerá a seguinte mensagem: “Permitir que o navegador da Internet acesse a câmera para usá-la neste site”, acompanhada do botão <b>Atualizar permissões</b>.',
  oz_tutorial_camera_android_webview_browser: 'Navegador nativo',
  oz_tutorial_camera_android_webview_instruction: '<ul><li><div>Vá em <strong>Configurações</strong> e abra <strong>Apps</strong>. Depois, acesse a lista de aplicativos (que pode estar como <strong>Gerenciamento de aplicativos</strong>, <strong>Ver todos os aplicativos</strong>, etc.).</div></li><li><div>Selecione o aplicativo, para o qual deseja habilitar o acesso à câmera.</div></li><li><div>Toque em <strong>Permissões</strong> e localize a opção <strong>Câmera</strong>.</div></li><li><div>Para permitir o acesso à câmera, selecione a opção apropriada que pode ser uma caixa de seleção ou um menu <strong>Permitir</strong>, <strong>Permitir somente durante o uso do app</strong>, etc.</div></li></ul><p>Esses passos podem variar de acordo com o dispositivo.\nEm caso de dificuldades, tente acessar o aplicativo de um navegador diferente, como o Google Chrome, para compatibilidade aprimorada.</p>',
  oz_tutorial_camera_android_webview_title: 'Para permitir que um aplicativo acesse a câmera em seu dispositivo Android, siga os passos abaixo:',
  oz_tutorial_camera_android_yandex_browser: 'Yandex Browser',
  oz_tutorial_camera_android_yandex_instruction: '<ul>\n    <li><div>Com a página de verificação biométrica do aplicativo aberta, toque no botão de menu (<b>“três pontos”</b>) no canto inferior direito do navegador.</div></li>\n    <li><div>Selecione <b>Sobre o site</b>.</div></li>\n    <li><div>Ative o botão de opção <b>Câmera</b>.</div></li>\n</ul>',
  oz_tutorial_camera_android_yandex_title: 'Para habilitar o acesso à câmera no <b>Yandex Browser</b> em um dispositivo Android, faça o seguinte:',
  oz_tutorial_camera_desktop_chrome_browser: 'Google Chrome',
  oz_tutorial_camera_desktop_chrome_instruction: '<ul>\n<li><div>Acesse o menu de <b>Personalização e controle do Google Chrome</b> clicando nos três pontos no canto superior direito\n</div>\n</li>\n<li>\n<div>\nSelecione <b>Configurações</b> no menu suspenso\n</div>\n</li><li>\n<div>\nNa seção <b>Privacidade e segurança</b> selecione <b>Configurações do site</b></div>\n</li><li>\n<div>\nNa seção <b>Permissões</b> clique em <b>Câmera</b></div>\n</li><li>\n<div>\nCertifique-se de que na seção <b>Comportamento padrão</b>, a opção <b>Os sites podem pedir para usar a câmera</b> esteja habilitada\n</div>\n</li><li>\n<div>\nAlém disso, veja se o nosso site não está na lista <b>Bloquear o uso da câmera</b>\n</div>\n</li></ul> ',
  oz_tutorial_camera_desktop_chrome_title: 'Para permitir o acesso à câmera no <b>Google Chrome</b>, siga estas instruções:',
  oz_tutorial_camera_desktop_default_browser: 'Chrome',
  oz_tutorial_camera_desktop_default_instruction: '<ul>\n<li><div>Acesse o menu de <b>Personalização e controle do Google Chrome</b> clicando nos três pontos no canto superior direito\n</div>\n</li>\n<li>\n<div>\nSelecione <b>Configurações</b> no menu suspenso\n</div>\n</li><li>\n<div>\nNa seção <b>Privacidade e segurança</b> selecione <b>Configurações do site</b></div>\n</li><li>\n<div>\nNa seção <b>Permissões</b> clique em <b>Câmera</b></div>\n</li><li>\n<div>\nCertifique-se de que na seção <b>Comportamento padrão</b>, a opção <b>Os sites podem pedir para usar a câmera</b> esteja habilitada\n</div>\n</li><li>\n<div>\nAlém disso, veja se o nosso site não está na lista <b>Bloquear o uso da câmera</b>\n</div>\n</li></ul> ',
  oz_tutorial_camera_desktop_default_title: 'Infelizmente, não reconhecemos o seu navegador. No caso do <b>Chrome</b>, este problema pode ser resolvido da seguinte forma:',
  oz_tutorial_camera_desktop_edge_browser: 'Microsoft Edge',
  oz_tutorial_camera_desktop_edge_instruction: '<ul>\n<li>\n<div>\nSiga para o menu clicando nos três pontos no canto direito superior\n</div>\n</li>\n<li>\n<div>\nSelecione <b>Configurações</b> no menu suspenso\n</div>\n</li>\n<li>\n<div>\nLocalize<b>Cookies e permissões do site</b></div>\n</li>\n<li>\n<div>\nClique em <b>Câmera</b></div>\n</li>\n<li>\n<div>\nCertifique-se de que a opção <b>Perguntar antes de acessar (recomendado)</b> esteja habilitada\n</div>\n</li>\n<li>\n<div>\nAlém disso, certifique-se de que o nosso site não esteja na lista <b>Bloqueado</b>\n</div>\n</li>\n</ul>',
  oz_tutorial_camera_desktop_edge_title: 'Para permitir o acesso à câmera no <b>Microsoft Edge</b>, siga estas instruções:',
  oz_tutorial_camera_desktop_firefox_browser: 'Mozilla Firefox',
  oz_tutorial_camera_desktop_firefox_instruction: '<ul>\n<li><div>Clique no botão do menu (<b>“três listras”</b> ou <b>hambúrguer</b>) no canto superior direito do navegador.</div></li>\n<li><div>Selecione <b>Configurações</b>.</div></li>\n<li><div>Na seção <b>Privacidade e segurança</b> abra <b>Configurações</b> próximo de <b>Câmera</b>. A opção <b>Bloquear novas solicitações de acesso à câmera</b> deve estar desabilitada.</div></li>\n<li><div>Se o nosso site não tiver permissão para acessar a câmera, troque o status na lista.</div></li>\n<li><div>Clique em <b>Salvar alterações</b>.</div></li>\n</ul>',
  oz_tutorial_camera_desktop_firefox_title: 'Para permitir o acesso à câmera no <b>Mozilla Firefox</b>, siga estas instruções:',
  oz_tutorial_camera_desktop_opera_browser: 'Opera',
  oz_tutorial_camera_desktop_opera_instruction: '<ul>\n<li>\n<div>\nClique no botão <b>Configurações</b> (<b>“engrenagem”</b>) no painel à esquerda.\n</div>\n</li>\n<li>\n<div>\nNa seção <b>Privacidade e segurança</b> abra <b>Configurações do site</b> e depois <b>Câmera</b>. A opção <b>Os sites podem pedir para usar a câmera</b> deve estar habilitada\n</div>\n</li>\n<li>\n<div>\nSe o nosso site não tiver permissão para acessar a câmera, mude o status na lista <b>Bloquear o uso da câmera</b>\n</div>\n</li>\n</ul>',
  oz_tutorial_camera_desktop_opera_title: 'Para permitir o acesso à câmera no <b>Opera</b>, siga estas instruções:',
  oz_tutorial_camera_desktop_yandex_browser: 'Yandex Browser',
  oz_tutorial_camera_desktop_yandex_instruction: '<ul>\n <li><div>Clique no botão de <b>configurações do navegador Yandex</b> (<b>“três listras”</b> ou <b>hambúrguer</b>) no canto superior direito do navegador.</div></li>\n <li><div>Selecione <b>Configurações</b></div></li>\n <li><div>Localize <b>sites</b> e abra a seção <b>Configurações avançadas do site</b></div></li>\n <li><div>Certifique-se de que, na seção <b>Acesso à sua câmera</b>, a opção <b>Pedir permissão</b> esteja escolhida</div></li>\n <li><div>Abaixo dessa opção, clique em <b>Configurações do site</b></div></li>\n <li><div>Certifique-se de que nosso site não seja mencionado na seção <b>Não permitido</b></div></li></ul>',
